{"operationName":"company","variables":{"id":"onesignal"},"query":"query company($id: ID!) {
  company(id: $id) {
    id
    name
    path
    slug
    imageUrl
    bannerImageUrl
    verified
    description
    twitterUsername
    websiteUrl
    location
    following
    amIOwner
    plans {
      slug
      __typename
    }
    features {
      slug
      __typename
    }
    tags {
      name
      __typename
    }
    tools {
      ...serviceFields
      __typename
    }
    jobs {
      count
      __typename
    }
    stackDecisions {
      count
      __typename
    }
    stacksList {
      count
      __typename
    }
    team {
      count
      __typename
    }
    followers {
      count
      __typename
    }
    blogPosts {
      count
      __typename
    }
    githubRepos {
      count
      __typename
    }
    socialPosts {
      count
      __typename
    }
    __typename
  }
}

fragment serviceFields on Tool {
  id
  name
  slug
  title
  verified
  imageUrl
  canonicalUrl
  path
  votes
  fans
  stacks
  following
  followContext
  __typename
}
"}
